column3:
กลัวสุดว่ามือที่สามคือคนนั้นแต่คิดว่าคงไม่ใช่อะะ
กูกลัวความแบคฮีเสมอ5555555
@vpnssi น่ากลัว สวนตูด?
@wooseoktedx แปลว่ากลัวค่ะ ภาษาอีสาน หนูบ่ใช่คนอีสานเด้อ แต่ชอบภาษานี้ 5555555
ใครดูอารยาแล้วกลัว แนะนำแชนแนล roger film อะ ตลกมาก แง้555555555555555
@Johnza_CP  ""พี่เป็นไรเปล่า?"" ก็ลองๆถามไป ""ไม่ได้กลัวหรอกใช่ม้า?..."" ค่อยๆฉีกยิ้มนิดๆ"

ไปทะเลที่ประการังสวยมาก็หลายที่ แต่กลับว่ายน้ำไม่เป็น มันน่าโมโหตัวเองนะ กลัวการจมน้ำอยู่ได้ ??
@chaljapcyx92 ฮึ่ยอยากกินขนม ตอนนั้นเค้าไปแปรงฟันมา กลัวเตงนอนแล้วไม่อยากกวน นอนไปก่อน ตื่นละโทรหาเค้าๆ
@jia2jyh แน่นอน บางคนรอจะให้เดบิวต์จนกลัวไปหมดว่าน้องจะถูกบริษัทเททิ้งรึเปล่า 55555
กลัวนกไม่ใช่เรื่องตลกนะเอาตรงๆถึงพูดแบบตลกก็เถอะ กลัวสัตว์ทุกอย่างบนโลกอ่ะแหละแต่นกเจอทุกวันไง
ใครๆ ก็มี ""ความกลัว"" ทั้งนั้น
